import { useState } from 'react'
import { authController } from '../../../controller/AuthController';
import { useNavigate } from "react-router-dom";
import './Login.css'
export default function Login() {
    let navigate = useNavigate();
    const [email,setEmail] = useState('')
    const [password,setPassword] = useState('')
    const [status,setStatus] = useState<number>()
    console.log(email,password);
    const login =()=>{
        authController.login(email,password).then(res=> {
            (setStatus(res))
        })
    }
    console.log(status);
    if(status != 404){
        navigate("/");
    }

    return (
        <div className="container1">
            <div className="container">
                <h1 className='login'>Login</h1>
                <form>
                    <div className="form-control">
                        <input type="text" id="username" placeholder="Email" onChange={e=> setEmail(e.target.value)}/>                  
                    </div>
                    <div className="form-control">
                        <input type="email" id="email" placeholder="Password" onChange={e=> setPassword(e.target.value)}/>                      
                    </div>            
                   <button className='btnLogin' onClick={login}>Login</button>
                    <div className="signup_link">Not a member? <a href="#">Signup</a></div>
                </form>
            </div>
        </div>

    )
}
